    this.page_namespace_id = page_namespace_id;
    this.page_title = page_title;
    this.timestamp = timestamp;
    this.directlyRelatedArtifacts = new ArrayList<RelatedArtifact>();
    this.revisions = new ArrayList<WikiRevision>();
